  var isPrime = true
  if(i &lt; 2){
    isPrime = false
  }
  else{
    for(var primeIterator = 2; primeIterator &lt; i; primeIterator++){
      if(i % primeIterator === 0){
        isPrime = false
      }
    }  
  }

  var output;
  if(i % 2 === 0){
    output = 'even'
  }
  else{
    output = 'odd'
  }

  if(isPrime){
    output = output + ' - prime'
  }
  console.log(output)
}

